import { useParams } from "react-router-dom";
import useFetch from "./useFetch";

const AthleteDetails = (props) => {
    const { sport } = useParams();
    const { data: athletes, error, isPending } = useFetch('http://localhost:3030/athletes?' + sport)

    return (
        <>
        <section>
            {isPending && <p>Loading athlete details...</p>}
            {error && <p>{error}</p>}
            {athletes && (
                <div>
                    <h1>{athletes.name}</h1>
                    <h2>{athletes.sport}</h2>
                    <h2>{athletes.data}</h2>
                </div>
            )}
        </section>
        </>
    )
}

export default AthleteDetails
